def iteration(i):
    print("Working for i={}".format(i))
    curr_candidates = []
    Q = Sec[i]
    def f(x, y, z, t, u):
        return Q[0]*x**2 + Q[1]*x*y + Q[2]*x*z + Q[3]*x*t + Q[4]*x*u + Q[5]*y**2 + Q[6]*y*z + Q[7]*y*t + Q[8]*y*u + Q[9]*z**2 + Q[10]*z*t + Q[11]*z*u + Q[12]*t**2 + Q[13]*t*u + Q[14]*u**2
