    print(len(candidates[0]))

    os.makedirs('data', exist_ok = True)
    with open(os.path.join('data', 'prepared_data.pkl'), 'wb') as f:
        pickle.dump([lisPr, Sec, Stab, candidates], f)

    print("Done calculating data!")
